import React from "react";

blogPosts = [
  {
    title: "test",
    url: "123"
  }
];

const BlogPosts = () => {
  return (
    <div>
      {blogPosts.map(({ title, url }) => (
        <a href={url} target="_blank" rel="nofollow noopener">
          {title}
        </a>
      ))}
    </div>
  );
};

export default BlogPosts;
